import React from "react";

const MovieSearch = () => {
  return (
    <div className="mt-5 page-container w-[500px] mx-auto">
      <input
        className="w-full outline-none px-3 py-2 rounded-lg bg-transparent"
        type="text"
      />
      <button></button>
    </div>
  );
};

export default MovieSearch;
